    false,nt"url": null,nt"notes": "This annual narrative report for Des Lacs
    National Wildlife Refuge outlines Refuge accomplishments during the 1982 calendar
    year. The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is covered. The report includes a planning section which discusses
    management planning. Refuge administration is outlined; information about personnel,
    funding, and safety is given. Habitat management is also covered; subjects include
    wetlands, forests, croplands, grasslands, grazing, haying, fire management, and
    pest control. The wildlife section of the report discusses wildlife diversity, endangered
    and threatened species, waterfowl, marsh birds and waterbirds, game mammals, wildlife
    propagation, and animal control. The public uses of the Refuge described in this
    report include outdoor classrooms, hunting, trapping, wildlife observation, outdoor
    recreation, and law enforcement. The equipment and facilities section of the report
    provides information about new construction, rehabilitation, major maintenance,
    equipment replacement, and energy conservation. Cooperative programs and items of
    interest are provided at the end.",nt"license_title": "License Not Specified",nt"extras":
